var newIdsToNewBlock, stringToNewBlock = generateNewBlockMapping()

func generateNewBlockMapping() (map[uint16]map[int]*NewBlock, map[string]*NewBlock) {
	newIdsToNewBlock := make(map[uint16]map[int]*NewBlock)
	stringToNewBlock := make(map[string]*NewBlock)
	for i, _ := range newBlocks {
		block := &newBlocks[i]
		for version, id := range block.Ids {
			if _, ok := newIdsToNewBlock[version]; ok {
				newIdsToNewBlock[version][id] = block
			} else {
				newIdsToNewBlock[version] = make(map[int]*NewBlock)
				newIdsToNewBlock[version][id] = block
			}
		}

		stringToNewBlock[block.Name] = block
	}

	return newIdsToNewBlock, stringToNewBlock
}

func GetGlobalMapping() map[string]*NewBlock {
	return stringToNewBlock
}

func GetNameFromNewBlocks(protocol uint16, id int) string {
	if val, ok := newIdsToNewBlock[protocol][id]; ok {
		return val.Name
	} else {
		return "minecraft:air"
	}
}

func GetNewBlockFromName(name string, protocol uint16) int {
	if val, ok := stringToNewBlock[name]; ok {
		return val.getLastId(protocol)
	} else {
		return 0
	}
}

func (block *NewBlock) getLastId(version uint16) int {
	last := uint16(0)
	id := 0
	for v, i := range block.Ids {
		if v <= version && version-last > version-v {
			last = v
			id = i
		}
	}
	return id
}
